  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:32.644382\",\n\t\"name\": \"midway-atoll-ironwood-removal-for-dune-restoration-and-sea-level-rise-resiliency\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project consists of removal
  of invasive, non-native ironwood trees (Casuarina equisetifolia) from approximately
  40 acres of high priority coastal strand habitat along the western shore of Sand
  Island, Midway Atoll. Native to Southeast Asia, the southern Pacific Islands, and
  Australia, at Midway, ironwood is a highly invasive tree species that forms dense,
  monotypic stands. It has demonstrated its ability to outcompete desired native plants
  by altering soil chemistry and limiting light. With very shallow roots, these trees
  also have a high propensity of blowdown and branch breakage even in moderate winds,
  which poses a significant hazard to wildlife, humans, and infrastructure. This also
  makes ironwood a dune destabilizer, causing moderate to severe coastal erosion in
  invaded areas. A coastal strand habitat with native species richness free of invasive
  species competition is superior at supporting dune accretion than monotypic ironwood
  habitats and is critical for long-term habitat viability in the face of sea level
  rise. Ironwoods preclude seabird nesting, pose flight hazards to seabirds, and are
  barriers to fledgling albatrosses attempting to reach the shoreline.\",\n\t\"license_title\":
